import styled from "styled-components";

export const TheOriginalSixStyle = styled.div`
  .icons_box {
    position: absolute;
    top: 10rem;

    left: 50%;

    div {
      height: 100vh;

      display: grid;
      grid-template-columns: 1fr 1fr 1fr;
      grid-template-rows: 5rem;
      justify-items: center;
    }
  }

  .icons_img {
    padding-top: 20rem;

    width: 3rem;
    height: 3rem;
  }
`;
